import React from 'react';
import { StyleSheet, Image, View } from 'react-native';
import { ListItem, Avatar } from 'react-native-elements';

function HomeScreen() {
    return (
        <View style={styles.container}>
            <ListItem style={styles.listItem} bottomDivider>
                <Avatar rounded title="H" containerStyle={{backgroundColor: 'black'}} />
                <ListItem.Content>
                    <ListItem.Title h4 numberOfLines={1}>A</ListItem.Title>
                    <ListItem.Subtitle numberOfLines={2}>B</ListItem.Subtitle>
                </ListItem.Content>
                <ListItem.Chevron />
            </ListItem>
            <ListItem bottomDivider>
                <Avatar rounded title="Hello" containerStyle={{backgroundColor: 'black'}} />
                <ListItem.Content>
                    <ListItem.Title h4 numberOfLines={1}>A</ListItem.Title>
                    <ListItem.Subtitle numberOfLines={2}>B</ListItem.Subtitle>
                </ListItem.Content>
                <ListItem.Chevron />
            </ListItem>
        </View>
    )
}

const styles = StyleSheet.create({
    container:{
        width: "100%",
        height: "100%",
        backgroundColor: "#E5E5E5",
        alignItems: "center",
        justifyContent: "center",
        padding: 10,
    },
    listItem: {
        width: "80%",
    }
});

export default HomeScreen
